        Vector2[] uvs;
        Vector4[] normals;
        Vector4[] centers;
        Color[] colors;
        int indexCount, colorVal;

        Vector4[] vertex;
        int cell;
        int[][] cellVertex;
        int[][][] cellEdgeIndex;
        int[][][] cellFaceIndex;
        Vector4[] cellNormal;
        float[] cellThreshold;
        float[] cellThresholdRec;
        Vector4[] cellCenter;
        Color[] cellColor;
