        Matrix4x4 axis;
        public enum Shapes
        {
            Cell_5 = 0,
            Cell_8_Hypercube = 1,
            Cell_16 = 2,
            Cell_24 = 3,
            Cell_120 = 4,
            Cell_600 = 5,
            Tetrahedron = 6,
            Cube = 7,
            Octahedron = 8,
            Dodecahedron = 9,
            Icosahedron = 10,
            Dice = 11,
        }
        [SerializeField] Shapes shape = Shapes.Cell_8_Hypercube;
        int shapeNum;
        [SerializeField] int colorNum = 2;
        [SerializeField] float cellSize = 0.5f;
        [SerializeField] float edgeSize = 0.1f;

        void CreateMesh()
        {
            shapeNum = (int)shape;
            InitShape();
            if (shapeNum < 11) InitMesh();
            else InitDice();
            // SetColors();
            AssetDatabase.CreateAsset(mesh, "Assets/Polychoron.asset");
        }

        void InitShape()
        {
            switch (shapeNum)
            {
                case 0:
                    Cell_5();
                    break;
                case 1:
                    Cell_8();
                    break;
                case 2:
                    Cell_16();
                    break;
                case 3:
                    Cell_24();
                    break;
                case 4:
                    Cell_120();
                    break;
                case 5:
                    Cell_600();
                    break;
                case 6:
                    Poly_4();
                    break;
                case 7:
                    Poly_6();
                    break;
                case 8:
                    Poly_8();
                    break;
                case 9:
                    Poly_12();
                    break;
                case 10:
                    Poly_20();
                    break;
                default:
                    Cell_8();
                    break;
            }
            cell = cellVertex.Length;
            cellColor = new Color[cell];
            cellThresholdRec = new float[cell];
            for (int i = 0; i < cell; i++) cellThresholdRec[i] = 1f / cellThreshold[i];
            SetPresetColor(colorNum);
        }

        void SetPresetColor(int n)
        {
            if (n == 0)
            {
                for (int i = 0; i < cell; i++) cellColor[i] = Color.HSVToRGB(0, 0, 2f/3);
                return;
            }
            colorVal = 0;
            for (int i = 0; i < colorList[shapeNum][n].Length; i++) colorVal = Mathf.Max(colorVal, colorList[shapeNum][n][i]);
            colorVal++;
            if (colorVal == 1) colorVal = 12;
            for (int i = 0; i < cellColor.Length; i++) cellColor[i] = Color.HSVToRGB(1f * colorList[shapeNum][n][i] / colorVal, 1, 1);
        }
        public void SetColors()
        {
            vertexCount = 0;
            for (int i = 0; i < cell; i++) for (int k = 0; k < cellVertex[i].Length * 3; k++) colors[vertexCount++] = cellColor[i];
            mesh.SetColors(colors);
        }

        void InitMesh()
        {
            mesh = new Mesh();
            // mesh.subMeshCount = 2;
            // GetComponent<MeshFilter>().sharedMesh = mesh;
            // polygonMaterial = GetComponent<MeshRenderer>().materials[0];
            // lineMaterial = GetComponent<MeshRenderer>().materials[1];
            mesh.Clear();

            int n = 0;
            for (int i = 0; i < cell; i++) n += cellVertex[i].Length;
            n = n * 3 + 8;
            vertices = new Vector4[n];
            uvs = new Vector2[n];
            normals = new Vector4[n];
            centers = new Vector4[n];
            colors = new Color[n];
            n = 0;
            for (int i = 0; i < cell; i++)
            {
                for (int j = 0; j < cellFaceIndex[i].Length; j++) n += cellFaceIndex[i][j].Length - 2;
                n += cellEdgeIndex[i].Length * 2;
            }
            polygonTriangles = new int[n * 3];
            n = 0;
            for (int i = 0; i < cell; i++) n += cellEdgeIndex[i].Length * 2;
            lineTriangles = new int[n];

            vertexCount = 0;
            Vector4 c;
            for (int i = 0; i < cell; i++)
            {
                for (int j = 0; j < cellVertex[i].Length; j++)
                {
                    c = cellCenter[i] * (1 - cellSize) + vertex[cellVertex[i][j]] * cellSize;
                    vertices[vertexCount] = c;
                    uvs[vertexCount] = new Vector2(cellThreshold[i], 1);
                    normals[vertexCount] = cellNormal[i];
                    centers[vertexCount++] = cellCenter[i];
                }
                for (int j = 0; j < cellVertex[i].Length; j++)
                {
                    c = cellCenter[i] * edgeSize + vertex[cellVertex[i][j]] * (1 - edgeSize);
                    vertices[vertexCount] = c;
                    uvs[vertexCount] = new Vector2(cellThreshold[i], 0);
                    normals[vertexCount] = cellNormal[i];
                    centers[vertexCount++] = cellCenter[i];
                }
                for (int j = 0; j < cellVertex[i].Length; j++)
                {
                    c = vertex[cellVertex[i][j]];
                    vertices[vertexCount] = c;
                    uvs[vertexCount] = new Vector2(cellThreshold[i], 0);
                    normals[vertexCount] = cellNormal[i];
                    centers[vertexCount++] = cellCenter[i];
                }
            }

            polygonTriangleCount = 0;
            indexCount = 0;
            lineTriangleCount = 0;
            for (int i = 0; i < cell; i++)
            {
                // for (int j = 0; j < cellEdgeIndex[i].Length; j++)
                // {
                    // lineTriangles[lineTriangleCount++] = indexCount + cellEdgeIndex[i][j][0];
                    // lineTriangles[lineTriangleCount++] = indexCount + cellEdgeIndex[i][j][1];
                // }
                for (int j = 0; j < cellFaceIndex[i].Length; j++)
                {
                    for (int k = 0; k < cellFaceIndex[i][j].Length - 2; k++)
                    {
                        polygonTriangles[polygonTriangleCount++] = indexCount + cellFaceIndex[i][j][0];
                        polygonTriangles[polygonTriangleCount++] = indexCount + cellFaceIndex[i][j][k + 1];
                        polygonTriangles[polygonTriangleCount++] = indexCount + cellFaceIndex[i][j][k + 2];
                    }
                }
                indexCount += cellVertex[i].Length;
                for (int j = 0; j < cellEdgeIndex[i].Length; j++)
                {
                    polygonTriangles[polygonTriangleCount++] = indexCount + cellEdgeIndex[i][j][0];
                    polygonTriangles[polygonTriangleCount++] = indexCount + cellEdgeIndex[i][j][1];
                    polygonTriangles[polygonTriangleCount++] = indexCount + cellVertex[i].Length + cellEdgeIndex[i][j][1];
                    polygonTriangles[polygonTriangleCount++] = indexCount + cellEdgeIndex[i][j][0];
                    polygonTriangles[polygonTriangleCount++] = indexCount + cellVertex[i].Length + cellEdgeIndex[i][j][1];
                    polygonTriangles[polygonTriangleCount++] = indexCount + cellVertex[i].Length + cellEdgeIndex[i][j][0];
                }
                indexCount += cellVertex[i].Length * 2;
            }

            Vector3[] v = new Vector3[vertexCount+8];
            for (int i = 0; i < 8; i++) v[vertexCount+i] = new Vector3(i/4, i%4/2, i%2) * 2 - Vector3.one;
            mesh.SetVertices(v);
            mesh.SetUVs(0, vertices);
            mesh.SetUVs(1, uvs);
            mesh.SetUVs(2, normals);
            // mesh.SetUVs(3, centers);
            mesh.SetTriangles(polygonTriangles, 0);
            // mesh.SetIndices(lineTriangles, MeshTopology.Lines, 1);
            SetColors();

            BoneWeight[] boneWeights = new BoneWeight[vertexCount+8];
            for (int i = 0; i < vertexCount; i++)
            {
                boneWeights[i].boneIndex0 = 1;
                boneWeights[i].weight0 = 1;
            }
            for (int i = 0; i < 8; i++)
            {
                boneWeights[vertexCount+i].boneIndex0 = 0;
                boneWeights[vertexCount+i].weight0 = 1;
            }
            mesh.boneWeights = boneWeights;
            Matrix4x4[] bindposes = new Matrix4x4[2];
            bindposes[0] = Matrix4x4.identity;
            bindposes[1] = Matrix4x4.identity;
            mesh.bindposes = bindposes;
            mesh.bounds = new Bounds(Vector3.zero, Vector3.one * 5);
        }

